subsection.def:
husband
                    (丈夫) means the husband of a widow of a
                contributor by any remarriage;

subparagraph.content:
in the case of an officer who has left the public service at the
                        commencement of the aforesaid Ordinance, at the rate at which he was
                        contributing immediately prior to leaving the public service;

was at the commencement of that Ordinance in service under the Government
                    on non-pensionable terms otherwise than on agreement as defined in section
                        2 of that Ordinance;
